CREATE FUNCTION public.invite(newownerid integer, newinvited character varying, newboardid integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
Declare invit int;
BEGIN
  IF (select exists(SELECT 1 from board where boardid=newboardid and userid=newownerid)) THEN
  
  SELECT userid into invit from users where pseudo=newinvited;

  IF (invit IS NOT NULL) THEN 	
	
    RETURN  invit;
    END IF;
  END IF;
  RETURN null;
END;

$$;


